import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import Question from '../Question/Question';
import { number, string } from 'prop-types';

export default class Quiz extends Component {
  constructor(props){
    super();
    this.state = {Q1: true}
    this.handleInputChange = this.handleInputChange.bind(this);
  }

  handleInputChange(event){
    const target = event.target;
    const value = target.type === 'checkbox' ? target.checked : target.value;
    const name = target.name;
    this.setState({
      [name]:string
    })
  }

  render() {
    return (
      <div>
        <h1>Quiz</h1>
        <h2>Hello person</h2>

        <div>
          <h3>You are a</h3> 
            <Question></Question>
            <h3>looking to find</h3> 
            <Question></Question>
        </div>
        <div className="quiz-father">
        <div>
        <h3>Conventional</h3><input name="Q1" type="range" min="1" max="5" value="5" class="slider" id="myRange"></input><h3>Creative</h3>
        </div>
        <div>
        <h3>Calm</h3><input name="Q2" type="range" min="1" max="5" value="5" class="slider" id="myRange"></input><h3>Active</h3>
        </div>
        <div>
        <h3>Organized</h3><input name="Q3" type="range" min="1" max="5" value="5" class="slider" id="myRange"></input><h3>Spontaneous</h3>
        </div>
        <div>
        <h3>Reserved</h3><input name="Q4" type="range" min="1" max="5" value="5" class="slider" id="myRange"></input><h3>Extroverted</h3>
        </div>
        <div>
        <h3>Disciplined</h3><input name="Q5" type="range" min="1" max="5" value="5" class="slider" id="myRange"></input><h3>Relaxed</h3>
        </div>
        </div>
      </div>
    )}
}



ReactDOM.render(
  <Quiz />,
  document.getElementById('root')
);
